import React from 'react';
import '../assets/css/nav.css';

function Nav() {
  const sections = [
    'Home',
    'World',
    'U.S.',
    'Politics',
    'N.Y.',
    'Business',
    'Opinion',
    'Science',
    'Arts',
    'Books',
    'Style',
    'Food',
    'Travel',
    'Magazine',
    'Real Estate',
    'Feed'
  ];

  return (
    <div>
      <ul className="nav justify-content-center custom-nav">
        {sections.map((section) => (
          <li className="nav-item" key={section}>
            <a className="nav-link" href={`#${section}`}>
              {section}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Nav;
